import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Price Range" filter by its heading text (h4)
    const priceRangeHeader = await page.waitForSelector('xpath=//h4[contains(text(), "Price Range")]', { timeout: 5000 });

    // Find the min and max price inputs using their placeholder attributes
    const minInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    const maxInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });

    // Clear and enter new price values
    await minInput.click({ clickCount: 3 });
    await minInput.fill('100');
    await maxInput.click({ clickCount: 3 });
    await maxInput.fill('500');

    // Take screenshot after filling in price range
    const filledShot = path.join(screenshotsDir, 'step_2_filled_price.png');
    await page.screenshot({ path: filledShot });
    screenshots.push(filledShot);

    // Find and click the "Apply" button using its visible text
    const applyButton = await page.waitForSelector('xpath=//button[contains(., "Apply") and contains(@class, "apply-filter")]', { timeout: 5000 });
    await applyButton.click();

    // Wait for a UI update: look for a notification or updated product list
    // We'll wait for a notification with class 'notification' and text containing 'Applied price filter'
    await page.waitForSelector('xpath=//div[contains(@class, "notification") and contains(text(), "Applied price filter")]', { timeout: 5000 });

    // Take screenshot after applying filter
    const appliedShot = path.join(screenshotsDir, 'step_3_applied_filter.png');
    await page.screenshot({ path: appliedShot });
    screenshots.push(appliedShot);

    // Extract the current min/max price values and count of visible products
    const minValue = await page.$eval('input[placeholder="Min"]', el => el.value);
    const maxValue = await page.$eval('input[placeholder="Max"]', el => el.value);

    // Count product cards displayed (grid or list)
    let productCount = 0;
    if (await page.$('.products-grid')) {
      productCount = await page.$$eval('.products-grid .product-card', els => els.length);
    } else if (await page.$('.products-list')) {
      productCount = await page.$$eval('.products-list .product-card-list', els => els.length);
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified UI update",
      extractedData: {
        minPrice: minValue,
        maxPrice: maxValue,
        visibleProductCount: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
